import React, { Component } from "react";
import ServiceOne from "../../elements/service/ServiceOne";

class SliderOne extends Component {
  render() {
    return (
      <div className="slider-activation">
        {/* Start Single Slide */}
        <div
          className="Slider3F slide slide-style-4 slider-fixed--height d-flex align-items-center bg_image--29"
          data-black-overlay="9"
        >
          <div className="container position-relative">
            <div className="row">
              <div className="col-lg-12">
                <div className="inner">
                  <h1 className="title theme-gradient">
                    {/* SMART <br />
                    FOAMS® */}
                    <h1
                      className="TituloH1 animated flipInX finite"
                      data-text="SMART
                    FOAMS®"
                    >
                      SMART <br />
                      FOAMS®
                    </h1>
                  </h1>
                </div>
              </div>
            </div>
            {/* Start Service Area */}
            <div className="service-wrapper service-white">
              <ServiceOne />
            </div>

            {/* End Service Area */}
          </div>
        </div>
        {/* End Single Slide */}
      </div>
    );
  }
}
export default SliderOne;
